import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// core components
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Button from "components/CustomButtons/Button.js";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Radio from "@material-ui/core/Radio";
import FiberManualRecord from "@material-ui/icons/FiberManualRecord";

import styles from "assets/jss/material-kit-react/views/quizPageSections/quizStyle.js";
import { Link } from "react-router-dom";

const useStyles = makeStyles(styles);

export default function ProductSection() {
  const classes = useStyles();

  const questions = [
    {
      id: 1,
      text: "You enjoy vibrate, social gatherings",
      category: "EI",
    },
    {
      id: 2,
      text: "You often spend time exploring unrealistic ideas",
      category: "JP",
    },
    {
      id: 3,
      text:
        "If your friend is sad, you try to solve their problem rather than comforting them",
      category: "TF",
    },
  ];

  const [selectedEnabled, setSelectedEnabled] = React.useState(false);

  function enable(questionNumber, answer) {
    console.log("QuestionNumber: " + questionNumber);
    console.log("Answer: " + answer);
  }

  return (
    <div className={classes.section}>
      {Object.values(questions).map((question, id) => (
        <div className={classes.questionBox}>
          <hr />
          <h2>{question.text}</h2>
          <br />
          <GridContainer>
            <GridItem xs={1} sm={1} md={1}></GridItem>
            <GridItem xs={2} sm={2} md={2}>
              <Button onClick={enable(id, 1)}>
                Not at all
              </Button>
            </GridItem>
            <GridItem xs={2} sm={2} md={2}>
              <Button id={id + "-2"} onClick={enable(id, 2)}>
                A Little
              </Button>
            </GridItem>
            <GridItem xs={2} sm={2} md={2}>
              <Button id={id + "-3"} onClick={enable(id, 3)}>
                Neutral
              </Button>
            </GridItem>
            <GridItem xs={2} sm={2} md={2}>
              <Button id={id + "-4"} onClick={enable(id, 4)}>
                Somewhat
              </Button>
            </GridItem>
            <GridItem xs={2} sm={2} md={2}>
              <Button id={id + "-5"} onClick={enable(id, 5)}>
                Very Much
              </Button>
            </GridItem>
            <GridItem xs={1} sm={1} md={1}></GridItem>
          </GridContainer>
          <hr />
        </div>
      ))}
      <Link to={"/results-page"} className={classes.button}>
        <Button className={classes.finish} color="warning">
          Finish
        </Button>
      </Link>
    </div>
  );
}
